import React, { useState, useEffect } from 'react';
import './Report.css'
import axios from 'axios';

function Report() {

    const [students, setStudents] = useState([]);
    const [selectedOption, setSelectedOption] = useState('');
  
    // Get data from the database 
    useEffect(() => {
      axios.get('https://localhost:7190/api/student')
        .then(response => {
          setStudents(response.data);
        })
        .catch(error => {
          console.error('Error fetching data:', error);
        });
    }, []);
  
    const handleOptionChange = (e) => {
      setSelectedOption(e.target.value);
    };
  
    useEffect(() => {
      if (selectedOption) {
        axios.get(`https://localhost:7190/api/student/${selectedOption}`)
          .then(response => {
            setStudents(response.data);
          })
          .catch(error => {
            console.error('Error fetching data:', error);
          });
      }
    }, [selectedOption]);



  return (
    <div>
      {/* upper section */}
      <div className='uppermainr'>
        <div className='upperr'>
          <fieldset className='field'>
            <legend>Student Details</legend>
            <table className='trow'>
              <tr>
                <div className='detailr'>
                  <div className='detailsr1'>

                  <div className='textbox'>
                <h2 className='h2'>student</h2>
                <select
    className='input'
    placeholder='Select Teacher'
    value={selectedOption}
    onChange={handleOptionChange}
  >
    {students.map((option, index) => (
      <option key={index} value={`${option.firstName} ${option.lastName}`}>
        {`${option.firstName} ${option.lastName}`}
      </option>
    ))}
  </select>

            </div>

   

            <div className='textbox'>
                <h2 className='h2'>Contact Person </h2>
                <input
              type="text"
              className='input'
              disabled
              value={students.contactPerson}
            />

            </div>

              <div className='textbox'>
                <h2 className='h2'>Contact No</h2>
                <input
              type="text"
              className='input'
              disabled
            //   value={contactNo}
            />

            </div>

            <div className='textbox'>
                <h2 className='h2'>Email Address</h2>
                <input
              type="email"
              className='input'
              disabled
            //   value={email}
            />

            </div>

            <div className='textbox'>
                <h2 className='h2'>DOB</h2>
                <input
              type="date"
              className='input'
              disabled
            //   value={dob}
            />

            </div>
            
     
            <div className='textbox'>
                <h2 className='h2'>Classroom</h2>
                <input
              type="number"
              className='input'
            //   value={classroom}
              disabled
              />
                </div>
                  </div>
                </div>
              </tr>
            </table>
          </fieldset>
        </div>
      </div>

      {/* lower section */}
      <div className='uppermainr'>
        <div className='lowerr'>
          <fieldset className='field'>
            <legend>Teacher Details</legend>
            <table className='table'>
              <thead>
                <tr>
                  <th>Classrooms</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>hello</td>
                  <td>hello</td>
                </tr>
              </tbody>
            </table>
          </fieldset>
        </div>
      </div>
    </div>
  )
}

export default Report
